import React from "react";
import Navbar from "./Navbar";
import Logo from "./Logo";
import Footer from "./Footer";
import Search from "./Search";

const Short = () => {
  return (
    <div
      style={{
        width: "100vw",
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        justifyContent: "space-between",
        alignItems: "center",
        padding: 0,
      }}
    >
      <Navbar />
      <div
        style={{
          marginTop: "-750px",
          display: "flex",
          gap: "50px",
          flexDirection: "column",
        }}
      >
        <Logo />
        <Search />
      </div>
      <div style={{ width: "800px", display: "flex", flexDirection: "column" }}>
        <div className="">
          <p style={{ fontSize: "16px", color: "black", opacity: "0.5" }}>
            Өгөгдсөн холбоос:
          </p>
          <p>https://www.web-huudas.mn</p>
        </div>
        <div className="">
          <p style={{ fontSize: "16px", color: "black", opacity: "0.5" }}>
            Богино холбоос:
          </p>
          <div style={{ display: "flex", gap: "24px" }}>
            <p>shortly.io/wbmn12</p>
            <p>Хуулж авах</p>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};
export default Short;
